import React from "react";

import "./Slider.css";

const SliderSkeleton = () => {
  return (
    <div className="skeleton_slider">
      {Array(6)
        .fill(0)
        .map((_, i) => (
          <div className="skeleton_slider_item" key={i}>
            <div className="skeleton_slider_item-circle"></div>
            <div className="skeleton_slider_item-title"></div>
          </div>
        ))}
    </div>
  );
};

export default SliderSkeleton;
